import React from 'react'
import CarCardImage from './CarCardImage'

const CarCard = () => {
  return (
    <div className="car_card">
      <div className="car_card_title">
        <h1> Toyota Corolla Sedan Comfort</h1>
      </div>

      <CarCardImage />
    </div>
  )
}

export default CarCard
